docstrings:
* For the given module prefix, instead of loading the
     * module with the given ID, substitude a different
     * module ID.
     *
     * @example
     * requirejs.config({
	*	map: {
	*		'some/newmodule': {
	*			'foo': 'foo1.2'
	*		},
	*		'some/oldmodule': {
	*			'foo': 'foo1.0'
	*		}
	*	}
	* });
     *
